import React, { useEffect, useState } from 'react';

import axios from 'axios';
 
const Details = ({ match }) => {

  const [product, setProduct] = useState(null);
 
  useEffect(() => {

    const productId = match.params.id; // Extract the product ID from the URL params

    axios.get(`http://localhost:5120/api/Product/${productId}`)

      .then((response) => {

        setProduct(response.data); // Update state with the fetched product data

      })

      .catch((error) => {

        console.error('Error fetching product details:', error);

      });

  }, [match.params.id]); // Trigger the effect when the ID in the URL changes
 
  return (

    <div className="container">

      <h1>Product Details</h1>

      {product ? (

        <div className="card">

          <div className="card-body">

            <h5 className="card-title">{product.title}</h5>

            <p className="card-text">Author: {product.author}</p>

            <p className="card-text">ISBN: {product.isbn}</p>

            <p className="card-text">Price: {product.price}</p>

            {/* Add more details as needed */}

            <p className="card-text">Description: {product.description}</p>

          </div>

        </div>

      ) : (

        <p>Loading...</p>

      )}

    </div>

  );

};
 
export default Details;
